import PropTypes from 'prop-types';

export default  Button = ({ handleLoadMoreButton }) => {
  return (
    <button className="Button" onClick={handleLoadMoreButton} id="load-more">
      LoadMore
    </button>
  );
};

Button.propTypes = {
  handleLoadMoreButton: PropTypes.func.isRequired,
};
